The Midnight Hour [1985] DVD Rip

Phil, Melissa, Mitch, Mary, and Vinnie are high school friends, who unwittingly raise the dead on Halloween night. Once the dead have returned, Pitchford Cove will never be the same again....or will it? The title &quot;The Midnight Hour&quot; appears on a full moon with DJ Wolfman Jack doing a voice over stating &quot;Look out it's the midnight hour baby!&quot;

